import { createRouter, createWebHistory } from 'vue-router'

import HomeComponent from './components/HomeComponent'
import UsuariosComponent from './components/UsuariosComponent'
import FormComponent from './components/commons/FormComponent'
import PageErrorComponent from './components/commons/PageErrorComponent'

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeComponent
  },
  // {
  //   path: '/:token',
  //   name: 'moodle',
  //   component: HomeComponent,
  // },
  {
    path: '/dashboard',
    name: 'dashboard',
    component: HomeComponent,
    children: [
      {
        path: 'usuarios',
        name: 'usuarios',
        component: UsuariosComponent,
        children: [
          {
            path: 'form',
            name: 'form',
            component: FormComponent,
            props: route => ({ Tipo: route.query.Tipo, Clase: route.query.Clase, Inputs: route.query.Inputs, Datos: route.query.Datos,Url: route.query.Url })      
          },
          {
            path: 'error',
            name: 'error',
            component: PageErrorComponent,
            props: route => ({ Codigo: route.query.Codigo, Mensaje: route.query.Mensaje, Descripcion: route.query.Descripcion}) 
          },

        ]
      },
    ]
  },
  {
    path: '/:catchAll(.*)',
    name: '*',
    component: PageErrorComponent,
  }

]

const Router = createRouter({
    history: createWebHistory(),
    routes
  })


export default Router
